- input: "TEXT\x1CC00362384\x1CX0\x1C\x1CF3XA\x1CDear Ms. Miller, Pursuant to your
    letter dated August 27, 2010 the PAC is amending the July Quarterly Report. The
    Amendment now accurately reflects the election designation for Dan Malfei for
    Congress, Jim Himes for Congress, Mike McMahon for Congress. Additionally, please
    be advised that the PAC had also amended the April, July October and Year end
    reports for 2009. This was done so that the proper election designations could
    be reflected for Bill Owens and Scott Murphy for Congress. They both had special
    elections and the contribution totals and election designations are now reported
    accurately. The PAC has now taken steps to ensure that the election designations
    are properly disclosed  on our reports. I trust the designations are now accurate
    and your Request for Additional Information is satisfied. However, feel free to
    contact me at 718-457-8585 if there is anything else you require. SCOTT KAUFMAN,
    Treasurer\n"
